import React from 'react';

import './MenuItem';

interface Props {
  text: string;
  clicked?: (t: string) => unknown;
}

export const MenuItem = (props: Props) => {
  const { text, clicked } = props;
  const itemClicked = () => {
    if (clicked)
      clicked(text);
  }
  return (
    <li className="menu-item" onClick={itemClicked}>{text}</li>
  )
}
